import React from "react";
import Navbar from "../components/Navbar";
import { Jumbotron, Container, Nav } from "react-bootstrap";

const Home = () => {
  return (
    <div>
      <Navbar />
      <Jumbotron fluid>
        <Container>
          <h1>Gig Alert</h1>
          <Nav
            activeKey="/homes"
            onSelect={selectedKey => alert(`selected ${selectedKey}`)}
          >
            <Nav.Item>
              <Nav.Link href="/homes">Active</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/bands">Bands</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/musicians">Musicians</Nav.Link>
            </Nav.Item>
          </Nav>
          ;
        </Container>
      </Jumbotron>
    </div>
  );
};

export default Home;
